import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Main from "./main";
import ButtonAppBar from "./appbar";



function App(props) {
    return (
        <Router>
            <div>
            <ButtonAppBar/>
            <Route path="/home" component={Main}/>
            <Route path="/home" component={Main}/>
            <Route path="/home" component={Main}/>
            <Route path="/home" component={Main}/>
            <Route path="/home" component={Main}/>
        </div>
        </Router>

    );
}

export default App;
